
IF OBJECT_ID('Players', 'U') IS NOT NULL
DROP TABLE Players
GO

IF OBJECT_ID('Teams', 'U') IS NOT NULL
DROP TABLE Teams
GO


CREATE TABLE Players
(
    PlayerName [NVARCHAR] (200) NOT NULL, 
    PlayerID INT NOT NULL,
    Team [NVARCHAR] (200) NOT NULL,
    Age INT NOT NULL,
    [Year] INT NOT NULL,
    GP INT NOT NULL,
    Wins INT NOT NULL,
    Losses INT NOT NULL,
    [Min] FLOAT NOT NULL,
    Points FLOAT NOT NULL,
    FGM FLOAT NOT NULL,
    FGA FLOAT NOT NULL,
    [FG%] FLOAT NOT NULL,
    [3PM] FLOAT NOT NULL,
    [3PA] FLOAT NOT NULL,
    [3P%] FLOAT NOT NULL,
    FTM FLOAT NOT NULL,
    FTA FLOAT NOT NULL,
    [FT%] FLOAT NOT NULL,
    OREB FLOAT NOT NULL,
    DREB FLOAT NOT NULL,
    Rebounds FLOAT NOT NULL,
    Assists FLOAT NOT NULL,
    TOV FLOAT NOT NULL,
    Steals FLOAT NOT NULL,
    Blocks FLOAT NOT NULL,
    PF FLOAT NOT NULL,
    FP FLOAT NOT NULL,
    DD2 FLOAT NOT NULL,
    DD3 FLOAT NOT NULL,
    [+/-] FLOAT NOT NULL,
    Efficiency FLOAT NOT NULL,
    PRIMARY KEY (PlayerID, [Year])
);
GO


CREATE TABLE Teams
(
    TeamID INT PRIMARY KEY,
    TeamName [NVARCHAR] (200),
    DateMade DATE NOT NULL,
    --PlayerName [NVARCHAR] (200) NOT NULL
    --FOREIGN KEY (PlayerName) REFERENCES Players

);
GO

Create Table PlayerAllocation
(
    TeamID INT,
    Year INT, 
    PlayerID INT,
    FOREIGN KEY(PlayerID, [Year]) REFERENCES Players,
    FOREIGN KEY(TeamID) REFERENCES Teams
);
GO



